# 3 "Lexer.fsl"
 

module Lexer
  
open System.Collections.Generic      (* for Dictionary *)
open Microsoft.FSharp.Text.Lexing
open Parser;

let lexemeAsString lexbuf = LexBuffer<char>.LexemeString lexbuf

(* Distinguish keywords from identifiers using function `keyword' below: *)

let keywords = new Dictionary<string, token>()

let _ = List.iter keywords.Add
            [
                ("and",      AND);
                ("false",    CSTBOOL false);
                ("from",     FROM);
                ("not",      NOT);
                ("or",       OR);
                ("select",   SELECT);
                ("true",     CSTBOOL true);
                ("where",    WHERE)
            ]

let keyword s = if keywords.ContainsKey(s) then keywords.Item(s) else NAME s

let cEscape s = 
    match s with 
        | "\\\\" -> '\\'
        | "\\\"" -> '\"'
        | "\\a"  -> '\007'
        | "\\b"  -> '\008'
        | "\\t"  -> '\t'
        | "\\n"  -> '\n'
        | "\\v"  -> '\011'
        | "\\f"  -> '\012'
        | "\\r"  -> '\r'
        | _      -> failwith "Lexer error: impossible C escape"
    
